import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { toast } from 'sonner';
import { useDispatch } from 'react-redux';
import { setUserAuthentication } from '../../../features/authenticationSlice';
import api from '../../../services/api';
import { Shield, LockKeyhole } from 'lucide-react';

const Login = () => {
    const [formData, setFormData] = useState({
        email: '',
        password: '',
    });

    const [error, setError] = useState('');
    const navigate = useNavigate();
    const dispatch = useDispatch();

    const { email, password } = formData;
    
    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const { data } = await api.post('/api/login/', formData);
            const { access, refresh, user_id, email, first_name, last_name, is_admin } = data;
    
            localStorage.setItem('tokens', JSON.stringify(data));
            localStorage.setItem('access', access);
            localStorage.setItem('refresh', refresh);
    
            const userDetails = {
                user_id,
                email,
                first_name,
                last_name,
                isAuthenticated: true,
                is_admin,
            };
    
            dispatch(setUserAuthentication(userDetails));
            toast.success('Login successful! Redirecting...');
    
            if (is_admin) {
                navigate('/admin/home');
            } else {
                navigate('/dashboard');
            }
        } catch (err) {
            setError('Invalid email or password');
            toast.error('Invalid login credentials');
        }
    };

    return (
        <div className="min-h-screen bg-gradient-to-b from-gray-900 to-gray-800">
            {/* Enhanced Header */}
            <div className="bg-gray-900/50 backdrop-blur-sm border-b border-gray-800">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="flex items-center justify-between h-16">
                        <div className="flex items-center space-x-3">
                            <Shield className="h-8 w-8 text-blue-500" />
                            <span className="text-xl font-bold text-white">Android App Portal</span>
                        </div>
                        <nav className="flex space-x-4">
                            <Link to="/about" className="text-gray-300 hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                                About
                            </Link>
                            <Link to="/contact" className="text-gray-300 hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                                Contact
                            </Link>
                        </nav>
                    </div>
                </div>
            </div>

            {/* Login Form Section */}
            <div className="flex min-h-[calc(100vh-4rem)] flex-col justify-center px-6 py-12 lg:px-8">
                <div className="sm:mx-auto sm:w-full sm:max-w-md">
                    <div className="flex justify-center">
                        <LockKeyhole className="h-12 w-12 text-blue-500 mb-4" />
                    </div>
                    <h2 className="mt-6 text-center text-3xl font-bold tracking-tight text-white">
                        Sign in to your account
                    </h2>
                </div>

                <div className="mt-8 sm:mx-auto sm:w-full sm:max-w-md">
                    <div className="bg-gray-800/50 backdrop-blur-sm py-8 px-6 shadow rounded-xl border border-gray-700">
                        <form onSubmit={handleSubmit} className="space-y-6">
                            <div>
                                <label htmlFor="email" className="block text-sm font-medium text-gray-300">
                                    Email address
                                </label>
                                <div className="mt-2">
                                    <input 
                                        id="email" 
                                        name="email" 
                                        type="email" 
                                        value={email}
                                        onChange={handleChange}
                                        autoComplete="email" 
                                        required 
                                        className="block w-full rounded-lg border border-gray-600 bg-gray-700/50 py-2 px-3 text-white shadow-sm placeholder:text-gray-400 focus:ring-2 focus:ring-blue-500 focus:border-blue-500 sm:text-sm sm:leading-6"
                                    />
                                </div>
                            </div>

                            <div>
                                <label htmlFor="password" className="block text-sm font-medium text-gray-300">
                                    Password
                                </label>
                                <div className="mt-2">
                                    <input 
                                        id="password" 
                                        name="password" 
                                        type="password" 
                                        value={password}
                                        onChange={handleChange}
                                        autoComplete="current-password" 
                                        required 
                                        className="block w-full rounded-lg border border-gray-600 bg-gray-700/50 py-2 px-3 text-white shadow-sm placeholder:text-gray-400 focus:ring-2 focus:ring-blue-500 focus:border-blue-500 sm:text-sm sm:leading-6"
                                    />
                                </div>
                            </div>

                            {error && <p className="text-red-500 text-sm">{error}</p>}

                            <div>
                                <button 
                                    type="submit" 
                                    className="flex w-full justify-center rounded-lg bg-blue-600 px-4 py-3 text-sm font-semibold text-white shadow-sm hover:bg-blue-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-blue-500 transition duration-300"
                                >
                                    Sign in
                                </button>
                            </div>
                        </form>

                        <p className="mt-6 text-center text-sm text-gray-400">
                            Don't have an account?{' '}
                            <Link to="/register" className="font-semibold text-blue-400 hover:text-blue-300 transition duration-300">
                                Sign up
                            </Link>
                        </p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Login;
